import React from 'react';
import logo from './logo.svg';
import './App.css';
import Button from 'react-bootstrap/button';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Button variant="primary">This is a button</Button>
      </header>

    </div>
  );
}

export default App;
